import React, { Component } from 'react';
import './Button.css';
import scaffold_rna_button from '../graphics/scaffold_button.svg';


export class ScaffoldButton extends Component {
    render() {
        return (
            <div>
                <img src={scaffold_rna_button} alt="" />
            </div>
        )
    }
}

export default ScaffoldButton
